script: |
  super -f text -I q13697.spq | sort > q13697.out

inputs:
  - name: q13697.spq
    data: |
      SELECT DISTINCT + col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE col1 - col0 - + + col0 / - ( + - col1 ) NOT IN ( 7 + col2 );
  - name: tab1

outputs:
  - name: q13697.out
    data: |
      14
      47
      5
